const img_api="https://image.tmdb.org/t/p/w1280";
const Movie=({title,poster_path,overview,vote_average}) =>(
    <div className="MovieCard" style="width: rem;">
        <img src={img_api}></img> 
        <>alt={poster_path}</>
    <div className="card-body">
      <p className={title}></p>
    </div>
  </div>
);
export default Movie;
